// function helper to generate pinpoints
function generate_pinpoints(lists) {
// lists: [{coor: [], title: ""}]
  let result = [];
  
  lists.forEach((arrayItem) => {
    let item = {
      "type": "Feature",
      "properties": {
        "title": arrayItem["title"]
      },
      "geometry": {
        "coordinates": arrayItem["coor"],
        "type": "Point"
      }
    }
    result.push(item);
  });

  return result;
}

